import "./App.css";
import { ChakraProvider, Container } from "@chakra-ui/react";

// components
import Home from "./Pages/Home";
import theme from "./theme";

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Container maxW="375px" borderWidth={1} pb={20}>
        <Home />
      </Container>
    </ChakraProvider>
  );
}

export default App;
